import React, { useMemo } from 'react'

export default function Model3D({ report }) {
    const boxitem = useMemo(() => {
        if (report && report.length) {
            const latestData = report[report.length - 1];
            return [
                {
                    count: latestData.Country,
                    type: 'country'
                },
                {
                    count1: latestData.Confirmed,
                    type: 'confirmed',
                },
                {
                    count2: latestData.Recovered,
                    type: 'recovered',
                },
                {
                    count3: latestData.Deaths,
                    type: 'death',
                },
                {
                    count4: latestData.Date,
                    type: 'Date'
                }
            ];
        }
        return [];
    }, [report]);

    return (
        < div className='model_box'>
            <div class="sketchfab-embed-wrapper  model_3d">
                <iframe title="SARS-CoV-2 (COVID-19)"
                    frameborder="0" allowfullscreen mozallowfullscreen="true"
                    webkitallowfullscreen="true" allow="autoplay; fullscreen; xr-spatial-tracking"
                    xr-spatial-tracking execution-while-out-of-viewport execution-while-not-rendered web-share
                    src="https://sketchfab.com/models/1533d2519b084a1580ddba0d3c5a3aff/embed?autostart=1&preload=1&ui_animations=0&ui_infos=0&ui_stop=0&ui_inspector=0&ui_ar=0&ui_help=0&ui_settings=0&ui_vr=0&ui_fullscreen=0&ui_annotations=0">
                </iframe>
            </div>
            <div className='box'>
                <div className='box-list'>
                    <div className='title'>
                        <h2
                        >
                            {
                                boxitem.map((data) =>
                                (

                                    <span>
                                        {data.count}
                                    </span>
                                ))
                            }
                        </h2>
                        <span>
                            Last Updated:
                            {
                                boxitem.map((data) =>
                                (

                                    <span>
                                        {data.count4.toISOString()}
                                    </span>
                                ))
                            }
                        </span>
                    </div>
                    <div className='box-ul'>
                        <ul>
                            <li>
                                Total number of infections
                                <br />
                                {
                                    boxitem.map((data) =>
                                    (

                                        <span>
                                            {data.count1}
                                        </span>
                                    ))
                                }
                            </li>
                            <li>
                                Total number of restores
                                <br />
                                {
                                    boxitem.map((data) =>
                                    (

                                        <span>
                                            {data.count2}
                                        </span>
                                    ))
                                }
                            </li>

                        </ul>
                        <br />
                        <ul>
                            <li>
                                Number of deaths
                                <br />
                                {
                                    boxitem.map((data) =>
                                    (

                                        <span>
                                            {data.count3}
                                        </span>
                                    ))
                                }
                            </li>
                            <li>
                                Number of people who received
                                <br />
                                the full dose
                                <br />
                                <span>
                                    10,693.141
                                </span>
                            </li>
                        </ul>
                    </div>
                    <div className='box-footer'>
                        <p>
                            "Total dose delivered" is the number of doses of vaccine given to everyone. Because some vaccines require multiple
                            doses, the number of people who have had the full dose of the vaccine may be lower.The "full dose" is the number
                            of people who have had the full dose of COVID-19 vaccine.
                        </p>
                    </div>
                </div>
                <div className='box-list box-list__item'>
                </div>
            </div>
        </div>
    )
}
